Preparo:
Massa: amassar a manteiga com as raspas de limão. Adicionar a farinha e a fécula e misturar até formar uma massa homogênea. Formar uma bola e deixar descansar em lugar fresco (de preferência na geladeira) por, pelo menos, meia hora;
Creme de confeiteiro: em uma tigela misturar bem as gemas com o açúcar e incorporar a farinha. Levar o leite com a baunilha ao fogo e quando estiver próximo de ferver, tirar do fogo e "temperar"a mistura de ovos, colocando o leite quente bem aos poucos, mexendo vigorosamente com um fouet a cada adição para impedir que as gemas cozinhem. Assim que o leite estiver completamente incorporado, voltar mistura de ovos e leite para panela e levar ao fogo baixo, mexendo constantemente, até mistura engrossar. Reservar e deixar esfriar em temperatura ambiente;
Creme de ricota: enquanto creme de confeiteiro esfria, preparar a mistura de ricota e frutas. Amassar bem a ricota e misturar com as gemas de ovo, o açúcar e a canela. Quando mistura estiver homogênea - ricota não pode ficar pedaçuda -, adicionar o creme de confeiteiro já frio e as frutas cristalizadas picadas. À esta mistura, adicionar em três etapas as claras em neve, misturando com cuidado para não perder o ar;
Preaquecer o forno;
Reservar 1/3 da massa para a decoração. Abrir os 2/3 de massa com poucos milímetros de espessura, forrar a forma, verter o creme de ricota. Abrir a massa que reservou, cortar em tiras e colocar sobre o recheio formando uma espécie de grade sobre ele. Assar em forno alto e preaquecido por aproximadamente 30'. Espere esfriar, desenforme e sirva com açúcar de confeiteiro polvilhado.
